import React, {Component} from 'react';
import '../scss/menu.scss';
import {MenuItem} from '../AddComponents/MenuItem';

class Menu extends Component {
    render() {
        return (
            <div className='menu'>
                <nav className='NavbarItems'>
                    <h4 className='logo'> Menu </h4>
                    <div className='MenuIcon'>

                    </div>
                    <ul>
                        {MenuItem.map((item)=>{
                            return <li><a  className={item.className} href={item.url}> {item.title} </a></li>
                        })}
                    </ul>
                </nav>
            </div>
        );
    }
}

export default Menu;
